import React from "react";

function Contenedor() {
  const elementos = [
    "Karate tradicional",
    "Defensa personal",
    "Entrenamiento físico",
    "Disciplina y respeto"
  ];

  const cabecera = ["Nombre", "Edad", "Cinturón"];
  const datos = [
    ["Ana", 12, "Blanco"],
    ["Luis", 15, "Amarillo"],
    ["Marta", 17, "Verde"],
    ["Carlos", 19, "Negro"]
  ];

  return (
    <div className="d-flex justify-content-between gap-4">
      {/* Lista */}
      <div className="card mb-4 shadow w-50">
        <div className="card-header bg-primary text-white fw-bold">
          Lista de entrenamientos
        </div>
        <ol className="list-group list-group-numbered">
          {elementos.map((item, index) => (
            <li key={index} className="list-group-item">
              {item}
            </li>
          ))}
        </ol>
      </div>

      {/* Tabla */}
      <div className="card mb-4 shadow w-50">
        <div className="card-header bg-success text-white fw-bold">
          Tabla de alumnos
        </div>
        <div className="table-responsive">
          <table className="table table-success table-striped mb-0 text-center">
            <thead className="table-light">
              <tr>
                {cabecera.map((col, index) => (
                  <th key={index}>{col}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {datos.map((fila, rowIndex) => (
                <tr key={rowIndex}>
                  {fila.map((dato, colIndex) => (
                    <td key={colIndex}>{dato}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Contenedor;
